// SadqDashboard.js
import React from "react";
import { useAuth } from "./AuthProvider";
import { useNavigate } from "react-router-dom";

function SadqDashboard() {
  const { logout } = useAuth();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate("/");
  };

  return (
    <div className="flex flex-col min-h-screen bg-gray-100 text-center">
      {/* Header */}
      <header className="bg-blue-900 text-white py-6 px-4 shadow">
        <h1 className="text-4xl font-bold">S.A.D.Q.</h1>
        <p className="text-lg font-light mt-1">
          Standardized Admissions Distribution Queue
        </p>
      </header>

      {/* Dropdown + Table */}
      <main className="flex flex-col items-center justify-center flex-grow px-4 py-10 space-y-6">
        <select className="bg-blue-900 text-white font-semibold px-6 py-2 rounded">
          <option>5:00PM</option>
        </select>

        <div className="overflow-x-auto w-full max-w-5xl">
          <table className="w-full text-sm border border-black bg-white">
            <thead className="bg-gray-100">
              <tr className="border border-black">
                <th className="py-2 px-4 border border-black font-bold">Role</th>
                <th className="py-2 px-4 border border-black font-bold">Last Admit Time</th>
                <th className="py-2 px-4 border border-black font-bold"># of Admits</th>
                <th className="py-2 px-4 border border-black font-bold">Chronic Load</th>
              </tr>
            </thead>
            <tbody className="bg-yellow-300">
              {["S1", "S2", "S3", "S4"].map((role, i) => (
                <tr key={role} className="border border-black text-center">
                  <td className="py-2 px-4 border border-black font-bold">{role}</td>
                  <td className="py-2 px-4 border border-black">04:19 PM</td>
                  <td className="py-2 px-4 border border-black">4</td>
                  <td className="py-2 px-4 border border-black">
                    <div className="flex items-center justify-center space-x-2">
                      <div className="w-24 h-4 bg-gray-200 rounded relative">
                        <div className="bg-blue-900 h-full w-3/5 rounded" />
                      </div>
                      <span>60%</span>
                    </div>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>

        {/* Admit Order */}
        <div className="bg-indigo-100 text-black px-6 py-4 w-full max-w-5xl mt-4 rounded shadow text-center">
          <div className="font-semibold text-lg mb-2">
            Order of Admits 7/29/2025 5:33PM
          </div>
          <div className="text-xl font-semibold">N5 &gt; S1 &gt; S4 &gt; S2 &gt; S3</div>
        </div>

        {/* Button */}
        <button className="mt-4 bg-blue-900 hover:bg-blue-800 text-white font-semibold py-2 px-6 rounded">
          Generate Queue
        </button>
      </main>

      {/* Footer */}
      <footer className="text-xs text-gray-600 text-center px-4 py-6">
        <p>© 2025 Genki MD LLC</p>
        <p>All rights reserved. Licensed use only.</p>
        <p>This tool is for workflow support only. Providers are responsible for final admission and care decisions.</p>
        <button
          onClick={handleLogout}
          className="mt-4 bg-red-500 hover:bg-red-600 text-white py-2 px-4 rounded"
        >
          Log Out
        </button>
      </footer>
    </div>
  );
}

export default SadqDashboard;
